import './App.css';

function App() {

  const header = <nav className='nav-bar'>
    <p>Logo</p>
    <ul>
      <li>
        <a href="/">Home</a>
      </li>
      <li>
        <a href="/contact-us">Contact</a>
      </li>
    </ul>
  </nav>
  return (
    <>
      <h1>This is Home</h1>
    </>
  );
}

export default App;
